    false,nt"url": null,nt"notes": "The goal of the monitoring plan is to provide
    data to determine if fish, colonial birds, waterfowl, endangered species, and their
    habitats at and adjacent to Mark Twain NWR are being impacted by contaminants. This
    field season study will determine the distribution, uptake, and toxicity of metal
    contaminants at several sites within the monitoring plan area. The data from the
    study will beu2022 used to: (1) map the distribution of contaminated sediments;
    (2) demonstrate the uptake of these contaminants in benthic macroinvertebrates and
    fish; (3) determine the toxicity of contaminated sediments to fish; and (4) identify
    areas for future monitoring at the Refuge and adjacent areas on the Upper Mississippi
    River. Site designs for specific areas of concern are given in the appendices.",nt"owner_org":
